import React from 'react';
import LeagueList from '../LeagueList/LeagueList';
import "./League.css";
const League = () => {
    return (
        <div>
            <h4>League Page</h4>
            {
                <LeagueList></LeagueList>
            }
        </div>
    );
};

export default League;
